import React from "react";

const Header = () => {
  return (
    <div className="header">
      <ul>
        <li>Home</li>
        <li>Beekeeping</li>
        <li>Store</li>
        <li>Blog</li>
        <li>Bits 'n' pieces</li>
        <li>About</li>
      </ul>
    </div>
  );
};

export default Header;
